    false,nt"url": null,nt"notes": "This narrative for Carolina Sandhills National
    Wildlife Refuge summarizes refuge activities for calendar year 1982. The report
    begins with a summary of climatic conditions and land acquisition during the period.
    A planning section outlines management plans, compliance projects, and research
    conducted in the refuge. The administration section covers refuge programs and staffing.
    Habitat management discusses croplands, grasslands, wetlands, forestlands, wilderness,
    and special areas. The wildlife section of the report covers endangered species,
    threatened species, waterfowl, migratory birds, mammals, fisheries resources and
    wildlife propagation. The public use section outlines recreational use, refuge visitation,
    interpretative exhibits, and law enforcement. Equipment needs and facilities projects
    are discussed next. Items of interest are provided at the end of the report.",nt"owner_org":
